import React from 'react';
import css from './App.css';

class App extends React.Component {

  state = {
    tasks: [{
      title: "Buy Milk",
      description: "order online on big basket"
    }, {
      title: "book",
      description: "return library book"
    },
    {
      title: "exercise",
      description: "do yoga and go on a walk"
    }, {
      title: "water",
      description: "drink 4l water everyday"
    }, {
      title: "cat",
      description: "feed the cat"
    }]
  };

  render() {

    var  tasks = {
      todo: [],
      inprocess: [],
      blocked: [],
      completed: []
    };

    this.state.tasks.forEach(task => {
      tasks.todo.push(task.title);
    })

    return (
      <React.Fragment>
        <div class="kanban-board">
          <div class="kanban">
            <h1> to do</h1>
            <h3> {tasks.todo}</h3>
          </div>
          <div class="kanban">
            <h1> in process</h1>
          </div>
          <div class="kanban">
            <h1> blocked</h1>
          </div>
          <div class="kanban">
            <h1> completed</h1>
          </div>
        </div>

      </React.Fragment>
    )

  }
}

export default App;
